import React from 'react';
import ScrollableAnchor from 'react-scrollable-anchor';
import ScrollAnimation from 'react-animate-on-scroll';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Box from '@material-ui/core/Box';
import PhoneIphoneIcon from '@material-ui/icons/PhoneIphone';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    root: {
        paddingTop: '150px',
    },
    phoneIcon:{

    }
}));

const Header = () => {
    const classes = useStyles();

    return (
        <ScrollableAnchor id="header">
            <ScrollAnimation animateIn="fadeIn" animateOnce={true}>
                <Box pt={6} display="flex" alignItems="center" flexDirection="column" className={classes.root}>
                    <PhoneIphoneIcon height="45px"/>
                    <Typography variant="h2" component="h1">
                        Mobile
                    </Typography>
                    <Typography variant="subtitle1" component="p" gutterBottom>
                        Above all, we are engineers, and our mission is to find the most elegant and economical
                        solutions to business problems. In our work we use various tools,
                    </Typography>
                    <Button
                        variant="contained"
                        href="#contact"
                        color="primary"
                        disableElevation
                        style={{ marginTop: 25 }}
                    >
                        Start out
                    </Button>
                </Box>
            </ScrollAnimation>
        </ScrollableAnchor>
    );
};

const styles = {
    highlighter: {
        backgroundColor: '#FFED4F',
        paddingLeft: 5,
        paddingRight: 5,
    },
};

export default Header;
